import React, { useEffect, useState } from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { getClasses } from '../../actions/classes';
import Spinner from '../layout/Spinner';
import './Classes.css';

const Classes = ({getClasses, classes}) =>{
  useEffect(()=>{
    getClasses();
  },[])
  return(
    <>
      {classes == null ? <Spinner/>:
        <div className='wrapper'>
          <div className='select-class'>
            <h2>Klasy</h2>
            <ul>
              {classes.map(({title})=><li>{title}</li>)}
            </ul>
          </div>
          <div className='students-view bg-dark'>
            ddd
          </div>
        </div>
      }
    </>
  )
}

Classes.propTypes = {
  getClasses: PropTypes.func.isRequired
}

const mapStateToProps = state => ({
  classes: state.classes.myClasses
});

export default connect(mapStateToProps, {getClasses})(Classes);
